First off… I’m good. Just want to say that first. 

@wandermanmedia posted a video a few days ago of me in the hospital and I’ve been getting a bunch of messages asking if I’m ok and what happened. 

While out on the @fatsacwake shoot with the crew I took the absolute hardest digger of my life. It happened so fast. I’ve taken a lot of back edges in my days of being a Wakeboarder but this one hit right and sent my body into fight or flight mode. 

I was fighting with all I had to not black out under the water, couldn’t figure out what was up verse down. I had a massive amount of tingling sensation from toes to head. EVERYTHING was tingling. Once the crew got me on the back I started hyperventilating for close to 30 min and tensing up. Body was just doing it’s own thing. 

Huge shout out to the whole crew I was with for making the call and taking me to the hospital and keeping my mind right. 

Once I got to the hospital they ran me through a concussion protocol and stabilized my neck cause I was having neck pain. 

 I got cat scans back they took my neck brace off and I was discharged with a concussion and a bulged disc. That was on Wednesday/Thursday. I’m doing good now, still have a good headache and my body is pretty dang stiff and soar to the touch but I’m moving around making the best of it. 

Big reminder that water still hurts. That one caught me off guard and ROCKED me hard. 

Thanks again to 
@joshtwelker 
@wandermanmedia 
@becgange 
@canevariphoto 
@jaminseipel 
@noahflegel 

And my wife for sitting with me all night and my in-laws for watching the kiddos. 

You need a village when things go wrong, thankful for my village 

God was on my side, could have been worse. 🙏🏽

Beyond stoked to take home the W on the fan vote for @alliancewake Less Than 5. I went out there with no expectations other than to have a good time, to flow, and to show my son a little bit of the wakeboard life. Good times getting to catch up with all the crew out there in Florida, been to long.

Thanks to everyone that voted for my run! I’m stoked I got to put down a line that everyone had a good time watching. 

God Bless 🤘🏽

